package site.itwill.dto;

public class BookInBook {
	private BookIn bookIn;
	private Book book;
	private BookOut bookOut;
	
	public BookInBook() {
		// TODO Auto-generated constructor stub
	}

	public BookIn getBookIn() {
		return bookIn;
	}

	public void setBookIn(BookIn bookIn) {
		this.bookIn = bookIn;
	}

	public Book getBook() {
		return book;
	}

	public void setBook(Book book) {
		this.book = book;
	}

	public BookOut getBookOut() {
		return bookOut;
	}

	public void setBookOut(BookOut bookOut) {
		this.bookOut = bookOut;
	}
	
	
}
